export interface MobileProcessorToken {
  token: string;
  paymentToken: PaymentToken;
  [k: string]: any;
}
export interface PaymentToken {
  billingContact: BillingContact;
  shippingContact: ShippingContact;
  token: Token;
  [k: string]: any;
}
export interface BillingContact {
  addressLines: string[];
  administrativeArea: string;
  country: string;
  countryCode: string;
  familyName: string;
  givenName: string;
  locality: string;
  postalCode: string;
  subAdministrativeArea: string;
  subLocality: string;
  [k: string]: any;
}
export interface ShippingContact {
  addressLines: string[];
  administrativeArea: string;
  country: string;
  countryCode: string;
  emailAddress: string;
  familyName: string;
  givenName: string;
  locality: string;
  phoneNumber: string;
  postalCode: string;
  subAdministrativeArea: string;
  subLocality: string;
  [k: string]: any;
}
export interface Token {
  paymentData: PaymentData;
  paymentMethod: PaymentMethod;
  transactionIdentifier: string;
  [k: string]: any;
}
export interface PaymentData {
  data: string;
  header: {
    ephemeralPublicKey: string;
    publicKeyHash: string;
    transactionId: string;
    [k: string]: any;
  };
  signature: string;
  version: string;
  [k: string]: any;
}
export interface PaymentMethod {
  displayName: string;
  network: string;
  type: string;
  [k: string]: any;
}
